async () => {
		//Call CIN API to get the address
		await selectCINDetails.run();
		await storeValue('vayIndCCIN', vayIndCCin.text);
		await storeValue('vayCinRegAddrr1',selectCINDetails.data[0].CIN_ADDRESS_LINE1);
		 await storeValue('vayCinRegAddrr2',selectCINDetails.data[0].CIN_ADDRESS_LINE2);
	await	storeValue('vayCinRegCity',selectCINDetails.data[0].CIN_ADDRESS_CITY);
	await	storeValue('vayCinRegDistrict',selectCINDetails.data[0].CIN_ADDRESS_DISTRICT);
	await		storeValue('vayCinRegState',selectCINDetails.data[0].CIN_ADDRESS_STATE);
	await	storeValue('vayCinRegCountry',selectCINDetails.data[0].CIN_ADDRESS_COUNTRY);
	await		storeValue('vayCinRegPinCode',selectCINDetails.data[0].CIN_ADDRESS_ZIP);	
	await		storeValue('vayCinRegPlace',selectCINDetails.data[0].CIN_REG_PLACE);
	await	storeValue('vayCinRegDate',selectCINDetails.data[0].CIN_REG_DATE);		
		updateCustomerIndcorp.run();
		navigateTo('India Corporate Address', {})

	}

